import React, { useState, useEffect } from "react";
import "./App.css";
import 'boxicons/css/boxicons.min.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import AppLayout from './components/applayout/AppLayout';
import Shop from "./components/shop/Shop";
import Home from "./components/home/Home";
import Demo from "./components/map/geolocation";
import Navbar from "./components/navbar/Navbar";
import Footer from "./components/footer/Footer";
import Productadd from "./components/productsadd/Productadd";
import Travelcard from "./components/travelcard/Travelcard";
import About from "./components/about/About";
import Loading from "./Loading";
import Sidebar from "./components/sidebar/Sidebar";

function App() {
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    setTimeout(() => setLoading(false), 3000);
  }, []);
  return (
      <>
      <Navbar />
      <BrowserRouter>
      <Routes>
        <Route path='/' element={ <AppLayout />}>
          <Route path='/Navbar' element={<Navbar />} />
          <Route path='./compcomponents/navbaronents/home/Home' element={<Home />} />
          <Route path='./components/travelcard/Travelcard' element={<Travelcard />} />
          <Route path='./components/shop/Shop' element={<Shop />} />
        </Route>
      </Routes>
    </BrowserRouter></>
  );
}

export default App;
